    initMap(){
        map.Layers.setBase(longdo.Layers.GRAY);
      }

    render() {
    const mapKey = '5e3612dcbfa88a77bf9cc67xxxxxxxxx'
    return (
      <div className="App">
        <LongdoMap id="longdo-map" mapKey={mapKey} callback={this.initMap} />
      </div>
    );
  }
}
